import React from "react";
import Document, { Html, Head, Main, NextScript } from "next/document";

export default class MyDocument extends Document {
  render() {
    return (
      <Html lang="en">
        <Head>
          <meta charSet="utf-8" />
          <meta content="IE=edge" />
          <link rel="shortcut icon" href="/static/assets/favicon.jpg" />
        </Head>
        <body>
          <Main />
          <NextScript />

          <script src="/static/assets/vendor/jquery.min.js"></script>

          <script src="/static/assets/vendor/popper.min.js"></script>
          <script src="/static/assets/vendor/bootstrap.min.js"></script>

          <script src="/static/assets/vendor/perfect-scrollbar.min.js"></script>

          <script src="/static/assets/vendor/dom-factory.js"></script>

          <script src="/static/assets/vendor/material-design-kit.js"></script>

          <script src="/static/assets/vendor/fix-footer.js"></script>

          <script src="/static/assets/js/app.js"></script>

          <script>
            {(function () {
              "use strict";
              var headerNode = document.querySelector(".mdk-header");
              var layoutNode = document.querySelector(".mdk-header-layout");
              var componentNode = layoutNode ? layoutNode : headerNode;

              componentNode.addEventListener(
                "domfactory-component-upgraded",
                function () {
                  headerNode.mdkHeader.eventTarget.addEventListener(
                    "scroll",
                    function () {
                      var progress = headerNode.mdkHeader.getScrollState()
                        .progress;
                      var navbarNode = headerNode.querySelector(
                        "#default-navbar"
                      );
                      navbarNode.classList.toggle(
                        "bg-transparent",
                        progress <= 0.2
                      );
                    }
                  );
                }
              );
            })()}
          </script>
        </body>
      </Html>
    );
  }
}
